Defendant Dekory K R Terrell in court with attorney Russell J. A. Jones.  Defendant Dekory K R Terrell in custody.  Sara Nicole Volden Schroeder appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statements by:  Ms. Arnedia M., defendant's mother.   The Court imposed the following sentence:   The Defendant's TOTAL LENGTH OF SENTENCE shall be 6 years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 3 years  with credit for  119 days time served.  Defendant shall serve 3 years on EXTENDED SUPERVISION.  The defendant IS eligible for the Challenge Incarceration Program, but not for the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. The Court STAYED THE SENTENCE and placed the defendant on probation to the State Department of Corrections for a period of four (4) years.
 * Court ordered defendant to provide a DNA sample.
CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - No contact with the victim, Hollis M.;
 - No contact with co-defendant Darryl Gooden;
 - No contact with co-actorsTekoray Terrell, Tramaine Reed, Ashley or Brittany;
 - Serve 12 months at the House of Correction, with release to the Day Reporting Center.  Good time allowed.
 - No controlled substances or alcohol;
 - AODA assessment; treatment, if needed;
 - Urine screens;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Parenting classes/counseling;
 - Obtain GED;
 - Pay the DNA surcharge, costs and disbursements by the end of probationary period.  Should defendant get revoked and be sent to prison, Court ordered monies taken by the Department of Correction from up to 25% of prison funds.  Balance would be then be paid while on Extended Supervision.   Failure to pay amounts in full would result in a civil judgment entered against defendant.

No request for restitution was received; therefore, the Court set restitution at zero.

